import PortfolioList from '../portfolioList/PortfolioList'
import './portfolio.scss'

export default function Portfolio() {

  const list = [
    {
      id: "featured",
      title: "Featured",

    },
    {
      id: "web",
      title: "web App",

    },

    {
      id: "mobile",
      title: "Mobile App",

    },

    {
      id: "content",
      title: "Content"

    },

  ];

  return (
    <div className='portfolio' id='portfolio'>

    <h1>Portfolio</h1>

      <ul>
        {
          list.map(item=>(
            <PortfolioList title={item.title}/>
          ))}
      </ul>

      <div className="container">
        <div className='item'>
            <img src="https://cdn-icons-png.flaticon.com/512/1240/1240940.png" alt=''/>
            <h3>Coffee App</h3>
        </div>
        <div className='item'>
            <img src="https://cdn-icons-png.flaticon.com/512/1240/1240940.png" alt=''/>
            <h3>Coffee App</h3>
        </div>
        <div className='item'>
            <img src="https://cdn-icons-png.flaticon.com/512/1240/1240940.png" alt=''/>
            <h3>Coffee App</h3>
        </div>
        <div className='item'>
            <img src="https://cdn-icons-png.flaticon.com/512/1240/1240940.png" alt=''/>
            <h3>Coffee App</h3>
        </div>
        <div className='item'>
            <img src="https://cdn-icons-png.flaticon.com/512/1240/1240940.png" alt=''/>
            <h3>Coffee App</h3>
        </div>

      </div>


    </div>
  )
}
